import React from "react";
import { useState } from "react";

// Components
import Header from "./Components/Header";
import FeedbackItem from "./Components/FeedbackItem";

const App = () => {
    const [feedback, setFeedback] = useState([
        {
            id: 1,
            rating: 10,
            text: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quisque dictum nisl et lacus commodo luctus. Aenean vehicula, purus in cursus luctus, enim odio fermentum ligula, dictum mollis ligula dolor non purus. Aenean non mi sed odio laoreet volutpat a non turpis. Curabitur sed lectus vitae mi tempus lobortis.",
        },
    ]);

    return (
        <>
            <Header />
            <div className="container">
                <FeedbackItem />
            </div>
        </>
    );
};

export default App;
